import React from 'react';

import styles from './../Style/Components/Servers.module.css';

//Modules 
import Server from './Server';

type MyProps = { Name: string, id: number, Active: number };
type MyState = { Picture: string, Active: boolean };
class Servers extends React.Component<MyProps, MyState> {
  public state: MyState;
  constructor(props) {
    super(props);
    this.state = {
      Picture: `${process.env.Storage_Url}/Servers/UUw40MdRDcUxdEy00Zuo/Icon`,
      Active: this.props.Active
    };
  }
  render() {
    return (
      <div role="button" className={styles.Container}>
        {
          this.state.Active && <div className={styles.Active}></div>
        }
        <picture className={styles.Icon}>
          <img className={styles.Icon_IMG} src={this.state.Picture} />
        </picture>
      </div>
    );
  }
}

export default Servers;
